import React, { Component } from 'react'
import {Route,Switch,Redirect,Link} from 'react-router-dom'

export default class SuccessBody extends Component {
    render() {
        const {title, buttonText1, buttonText2} = this.props;
        return (
            <div>
                <section className="highlight-clean" style={{marginTop: "85px"}}>
                    <div className="container" style={{width: "1171px"}}>
                        <div className="intro">
                            <h2 className="text-nowrap text-capitalize text-center" style={{height: "108px",width: "500px",marginRight: '0px',fontFamily: "Adamina, serif",fontSize: '32px',marginBottom: '-25px',marginLeft: '-15px',marginTop: '27px'}}>{title}</h2>
                        </div>
                        <div className="buttons">
                            <Link className="btn btn-primary" role="button" to="/industryPage/grading" style={{width: '180px',height: '60px',fontSize: '16px'}}>{buttonText1}</Link>
                            <Link className="btn btn-light border rounded" role="button" to="/industryPage/home" style={{width: '180px',height: '60px',fontSize: '16px'}}>{buttonText2}</Link>
                        </div>
                    </div>
                </section>
            </div>
        )
    }
}
